import React, { useEffect } from 'react';
import Pages from '../Pages/Pages';


import { connect } from 'react-redux';
// import {  resetSocialMediaSelections, } from '../../../redux/actions/socialMediaActions';

import {
    Col,
    Row,
} from 'react-bootstrap';

function Dashboard(props) {
    
    let {
        socialMediaPageSelected,

        // FUNCTIONS
    } = props;

    return (
        <div style={{ height: window.innerHeight * 2, marginTop: '135px' }}>
            
            <Row>
                <p className="my-agents-table-label" style={{ fontSize: '30px', fontFamily: 'Poppins SemiBold' }}>Dashboard</p>
            </Row>

            <Pages title="Most requested intents" titleStyling={{color: '#4D4F5C', fontSize: '16px', fontFamily: 'Poppins Medium' }} />

            {socialMediaPageSelected 
            &&
            <p>IM THE DASHBOARD</p>
            }

        </div>
    )
}


const mapStateToProps = (state) => {
    return {
        socialMediaPageSelected : state.socialMediaR.socialMediaPageSelected,
    }
};

export default connect(mapStateToProps, { })(Dashboard);
